def transpose(l1):
    l2 = []
    for i in range(len(l1[0])):
        row = []
        for item in l1: row.append(item[i])
        l2.append(row)
    return l2
def dotProd(x, y): return [[dotProd2(x2, y2) for y2 in transpose(y)] for x2 in x]

